import React from 'react';
import { Link } from 'react-router-dom';

export default function ArticleNavgation() {
    return (
        <div>
            <div className="article_sub_navigation" style={articleSubNavigation}>
                <ul style={articleSubNavigationUl}>
                    <li id="selected"><Link to="/article">HOT 10</Link></li>
                    <li id="selected"><Link to="/article">Latest</Link></li>
                    <li id="selected"><Link to="/article">Nutrition</Link></li>
                    <li id="selected"><Link to="/article">Health</Link></li>
                    <li id="selected"><Link to="/article">Beauty</Link></li>
                </ul>
            </div>
        </div>
    )
};

const articleSubNavigation = {
    height: '10%',
    textAlign: 'center',
};

const articleSubNavigationUl = {
    display: 'inline-block',
    listStyle: 'none',
    margin: '0',
    padding: '0'
};

let listStyle = document.getElementsByName("li");
listStyle.style.css = 'list-style: none; height: 50px; line-height: 50px; width: 150px; display: inline-block; background-color: #F9F5EB; border-radius: 10px; margin: 30px;';

